import unittest

# beats 98.68%
class Solution(object):
    def findLonelyPixel(self, picture):
        """
        :type picture: List[List[str]]
        :rtype: int
        """
        # idea: find all black pixels, record the num of each row and col
        m, n = len(picture), len(picture[0])
        row_num = [0]*m
        col_num = [0]*n
        blacks = []
        for i in range(m):
            for j in range(n):
                 if picture[i][j] == 'B':
                    if row_num[i] < 2 and col_num[j] < 2:
                        blacks.append((i,j))
                    row_num[i] += 1
                    col_num[j] += 1
        res = 0
        for (i,j) in blacks:
            if row_num[i] == 1 and col_num[j] == 1:
                res += 1
        return res

# beats 98.68%
class Solution_V1(object):
    def findLonelyPixel(self, picture):
        """
        :type picture: List[List[str]]
        :rtype: int
        """
        # idea: find all black pixels, record the num of each row and col
        m, n = len(picture), len(picture[0])
        row_num = [0]*m
        col_num = [0]*n
        blacks = []
        for i, row in enumerate(picture):
            for j, val in enumerate(row):
                 if val == 'B':
                    if row_num[i] < 2 and col_num[j] < 2:
                        blacks.append((i,j))
                    row_num[i] += 1
                    col_num[j] += 1
        res = 0
        for (i,j) in blacks:
            if row_num[i] == 1 and col_num[j] == 1:
                res += 1
        return res


